import React, { Component } from 'react'
import { style_mapping } from "../../styled";

const {
    profile: { ProfileHeaderContainer, ProfilePicture, ProfileName, ProfileCommands }
} = style_mapping;

class ProfileHeader extends Component {
  render() {
    return (
      <ContentArea>
      <ProfileHeaderContainer>
        <ProfilePicture />
        <ProfileName />
        <ProfileCommands />
      </ProfileHeaderContainer>
      </ContentArea>
    )
  }
}

export default ProfileHeader
